import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { createTodo, getTodos } from "../apis";

export default function Todo() {
    const navigate = useNavigate()
    const token = localStorage.getItem("access_token")
    const [newTodo, setNewTodo] = useState("")
    const [todoList, setTodoList] = useState([])

    // 페이지 시작시
    useEffect(() => {
        // Todo 리스트 받아오기
        const getTodoList = async () => {
            try {
                const response = await getTodos()
                setTodoList(response)
            } catch (error) {
                console.log(error)
            }
        }

        if (token) getTodoList()
        else {
            navigate("/signin")
        }
    }, [])

    return (
        <>
            <button onClick={() => navigate("/")}>메인 이동</button>
            <div>TodoList</div>
            {todoList.map(({id, todo, isCompleted, userId}) => {
                return <div>{id}</div> })}
            <div>TodoMaker
                <input data-testid="new-todo-input" onChange={(e) => setNewTodo(e.target.value)} />
                <button data-testid="new-todo-add-button" onClick={() => createTodo(newTodo)}>추가</button>
            </div>
        </>
    )
}
